const evangTermineResetCookieValue=function(){let e=document.cookie.split(";");for(let i=0;i<e.length;i++)if(e[i].trim().startsWith("etpluginuid")){let n=e[i].split("=");document.cookie=n[0]+"=-1; max-age=10; SameSite=None; Secure"}},evangTerminePluginUid=function(){evangTermineResetCookieValue();const e=document.querySelectorAll(".plugin-evangelische-termine a");for(let i=0;i<e.length;i++)e[i].addEventListener("click",(function(){const e=this.dataset.pluginuid;document.cookie="etpluginuid"+e+"="+e+"; max-age=10; SameSite=None; Secure"}))};evangTerminePluginUid();
